import React, { Component } from 'react'
import Home from './components/pages/home'
import { BrowserRouter, Route } from 'react-router-dom';

export class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <BrowserRouter>
            <Route>
              <Home />
            </Route>
          </BrowserRouter>
        </header>
      </div>
    )
  }
}

export default App
